 and began striking people. It was chaos. The screams of those being beaten were terrifying to hear. I felt helpless,\u201d reports Carrie Bumgardner Luna. Despite the fact that he was not resisting arrest, one Occupier was repeatedly beaten in the face with the butt of a mag-lite. After already being beaten and cuffed, an officer then methodically snapped and broke two of his fingers. Another Occupier was repeatedly beaten in the head requiring staples. Both Occupiers were hospitalized. A third Occupier was hit in the neck and choked with a baton, thrown to the ground and kicked in the face causing permanent damage to his jaw structure. \u201cIt\u2019s shocking and disheartening to see people you love being violently attacked, bleeding from their bruised faces. It was a senseless betrayal of trust. It really helps me better understand what people of color in our city go through every day,\u201d said Oren Goldberg. Occupy St. Louis has always been responsible stewards of public space and disavow the graffiti damage done to the Compton Hill Reservoir Park. ### Comments are closed. OSTL Schedule Events on July 31, 2012 Peabody Energy Protest Starts: 6:00 pm Ends: July 31, 2012 - 7:30 pm Location: Peabody Opera House, 14th & Market, St.Louis, MO Description: There is no clean coal, that's why. It's time for clean energy now, and a world for all of us. More details... Events on August 4, 2012 Reclaim St. Louis - The McMillan Project Starts: 10:00 am Ends: August 5, 2012 - 1:00 pm Location: 4716 McMillan Description: Reclaim St Louis will be meeting at 4716 McMillan this Saturday morning from 10am-1pm. We will be doing work on the inside and outside of the property. Check the Reclaim St. Louis page for specifics on how far along the project has come and what we might need to the work day. The McMillan Project is a total rehab of a run down property to be turned over to the neighborhood. This space will used by the community for their needs, as they see appropriate. This 